const teambuilder=require('../js/morse.js');let assert=require('assert');describe('CeasarCodeDecoder',function(){describe('decrypt',function(){it('should return the correct number',function(){let a='--/---/.-./..././/./.-.//.-.././-//-./---/-.-',b=teambuilder.Morse(a);assert.equal(b.decrypt(),'morse er let nok')})}),describe('encrypt',function(){it('should return the correct number',function(){let a='morse er let nok',b=teambuilder.Morse(a);assert.equal(b.encrypt(),'--/---/.-./..././/./.-.//.-.././-//-./---/-.-')})})})